import React from "react";
import "./style.css";

const MentorCreateProfile = () => {
  return (
    <>
      <div class="container">
        <h1>    Create Profile</h1>
      <img src="/avatar.png" alt="female profile" />
    
        <button
          class="signup"
          onclick="document.location='(p6)Mentor_Successful_Signup.html'"
        >
          Submit
        </button>
      </div>
    </>
  );
};

export default MentorCreateProfile;
